import { createIcon } from "../icon/createIcon";

export const DoubleChevronUpIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="DoubleChevronUpIcon">
    <path d="M.501 5.397 6.003.5l5.502 4.897L10.502 6.5 6.004 2.496 1.506 6.5.503 5.397zm.002 5.058L6.003 5l5.5 5.455-1.055 1.045-4.445-4.408L1.558 11.5.503 10.455z" />
  </svg>,
  "DoubleChevronUp",
  "double chevron up"
);
